  <https://dblp.org/rec/conf/scam/BartoliniP01> dblp:authoredBy ?author1 .
  ?author1 dblp:authoredBy <https://dblp.org/rec/conf/hybrid/HenzingerMP01> .
}

PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT ?author ?affiliation WHERE {
  <https://dblp.org/rec/conf/iceccs/LamprechtMS09> dblp:authoredBy ?author .
  ?author dblp:primaryAffiliation ?affiliation .
  FILTER ( CONTAINS( LCASE( ?affiliation ) , "university of limerick" ) )
}

PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT ( COUNT( DISTINCT ?affiliation ) AS ?count ) WHERE {
  <https://dblp.org/rec/conf/lak/KnightA16> dblp:authoredBy ?author .
  ?author dblp:primaryAffiliation ?affiliation .
}

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT ?venue WHERE {
  OPTIONAL {
    <https://dblp.org/rec/conf/pods/Gelder89> dblp:publishedInStream ?stream .
    ?stream rdfs:label ?venue
  }
  OPTIONAL {
    <https://dblp.org/rec/conf/pods/Gelder89> dblp:publishedIn ?venue .
    FILTER ( LANG( ?venue ) = '' )
  }
  FILTER ( BOUND( ?venue ) )
}

PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT ?pub ?title WHERE {
  ?pub dblp:authoredBy <https://dblp.org/pid/60/205> .
  ?pub dblp:title ?title
}

PREFIX dblp: <https://dblp.org/rdf/schema#>
ASK {
  {
    ?pub dblp:authoredBy <https://dblp.org/pid/233/4002> .
    ?pub dblp:publishedInStream <https://dblp.org/streams/conf/cinc>
  } UNION {
    ?pub dblp:hasSignature ?s .
    ?s dblp:author <https://dblp.org/pid/233/4002> .
    ?pub dblp:publishedInStream <https://dblp.org/streams/conf/cinc>
  }
}

PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT ?pub ?title ?venue WHERE {
  ?pub dblp:title ?title .
  ?pub dblp:yearOfPublication '2011' ^^ xsd:gYear .
  FILTER ( CONTAINS( LCASE( ?title ) , 'tree construction' ) ) .
  OPTIONAL {
    ?pub dblp:publishedInStream ?stream .
    ?stream rdfs:label ?venue
  }
  OPTIONAL {
    ?pub dblp:publishedIn ?venue .
    FILTER ( LANG( ?venue ) = '' )
  }
  FILTER ( BOUND( ?venue ) ) .
  FILTER ( ?venue = 'Handbook of Statistical Bioinformatics' )
}

PREFIX dblp: <https://dblp.org/rdf/schema#>
ASK WHERE {
  ?pub dblp:authoredBy <https://dblp.org/pid/121/9027> .
  ?pub dblp:authoredBy <https://dblp.org/pid/04/4347>
}

PREFIX dblp: <https://dblp.org/rdf/schema#>
ASK {
  <https://dblp.org/rec/conf/emisa/SimonD04> dblp:authoredBy ?author .
  <https://dblp.org/rec/conf/isaac/Farach-ColtonT15> dblp:authoredBy ?author .
}

PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT ?pub ( COUNT( ?author ) AS ?authorCount ) WHERE {
  VALUES ?pub {
    <https://dblp.org/rec/journals/jimaging/MorigiA22> <https://dblp.org/rec/journals/ijcbdd/ThotaN21>
  }
  ?pub dblp:authoredBy ?author
}
GROUP BY ?pub

PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT ?pub WHERE {
  ?pub dblp:hasSignature ?s .
  ?s dblp:author <https://dblp.org/pid/11/4677>
}

PREFIX dblp: <https://dblp.org/rdf/schema#>
ASK {
  <https://dblp.org/rec/journals/scientometrics/SaritasBKK21> dblp:authoredBy ?author .
  <https://dblp.org/rec/conf/igarss/ImperatorePL18> dblp:authoredBy ?author .
}

PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT ( COUNT( DISTINCT ?pub ) AS ?count ) WHERE {
  VALUES ?author {
    <https://dblp.org/pid/137/7919> <https://dblp.org/pid/194/4633> <https://dblp.org/pid/223/1801> <https://dblp.org/pid/23/10193> <https://dblp.org/pid/269/0284> <https://dblp.org/pid/269/0753> <https://dblp.org/pid/269/0855> <https://dblp.org/pid/269/1340>
  }
  ?pub dblp:authoredBy ?author .
  ?pub dblp:publishedIn "PLoS Comput. Biol." .
}

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT ?venue WHERE {
  {
    <https://dblp.org/rec/conf/IEEEscc/PuXL08> dblp:publishedInStream ?stream .
    ?stream rdfs:label ?venue
  } UNION {
    <https://dblp.org/rec/conf/icchp/SaifF16> dblp:publishedInStream ?stream2 .
    ?stream2 rdfs:label ?venue
  }
}

PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT ( COUNT( DISTINCT ?pub ) AS ?paperCount ) WHERE {
  ?pub dblp:authoredBy <https://dblp.org/pid/04/2926> .
}

PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT ?pub ?year WHERE {
  VALUES ?pub {
    <https://dblp.org/rec/journals/coling/Rijsbergen06> <https://dblp.org/rec/conf/smc/MahmoudKRA10>
  }
  ?pub dblp:yearOfPublication ?year
}

